  `bs_duiyuanshu` smallint(3) DEFAULT '4' COMMENT '每队（单位）的队员数，计算团体成绩时需要的，实际多的队取最好成绩，实际缺的队可以设置允许排名（缺员的名次也有2种选择）或不。。。',
  `bs_PHxianhou` int(3) NOT NULL DEFAULT '1' COMMENT '先后手确定：1【平衡先后手】、#【自然调节法】',
