  `bs_tongxianhou` int(3) NOT NULL DEFAULT '2' COMMENT '先后走相等的先后方式：【①取相遇者两号相加之和，奇数小号先走，偶数大号先走】【②单数轮次小号先走，双数轮次大号先走】两种方式可选择其中一种。电脑编排按程序执行；',
