  `bs_dilunfen` varchar(7) DEFAULT NULL COMMENT '在第【$[0]】轮未得【$[1]】分淘汰；默认0x0或空， 模式[3x6]',
  `bs_kongbufen` int(3) NOT NULL DEFAULT '1' COMMENT '因淘汰轮空补小分【是】【否】；',
  `bs_guobufen` int(3) NOT NULL DEFAULT '1' COMMENT '过关补小分【是】【否】；',
  `bs_peiduimoshi` int(3) NOT NULL DEFAULT '1' COMMENT '第一轮选手配对模式默认1，目前取值范围[1，5]临近，首位，拦腰，随机，上下半区',
  `bs_xianhoumoshi` int(3) NOT NULL DEFAULT '11' COMMENT '第一轮先后手模式；默认2，目前取值范围[1,11] ；默认是11：根据配对模式的默认先后',
  `bs_chafengaoping` float NOT NULL DEFAULT '0.5' COMMENT '后三轮：（默认值0：不考虑，>0才进行）配对后，优先平衡相差？分和？分 以上高分一方的先后走，如导致另一选手多三（或连三）则可以不处理；；不差那么多分的仍按正常；#若二人相差1/2分，仍以抽签方法决定先后走。《可选》',
  `bs_zuiJliansan` int(3) NOT NULL DEFAULT '1' COMMENT '最后一轮：在各轮已经考虑平衡先后手的情况下，如果在最后一轮中，出现连三先配对、连三后配对，均不拆开重排。积分编排的同分数段必须保证充分配对。',
  `bs_guicheng` text COMMENT '赛事规程的简介',
  `bs_key` varchar(24) DEFAULT NULL COMMENT '任何用户可通过此密码来管理本场比赛',
  `bs_lunkongmoshi` tinyint(1) NOT NULL DEFAULT '0' COMMENT '轮空的模式，目前有2种：1 只能是最低分；0没轮空过的低分',
  `bs_grpm_moshi` varchar(32) NOT NULL DEFAULT 'ACDEF' COMMENT '个人排名模式：如ABCDEFGHIJ。默认ACDEF 总分、对手分、胜局、犯规、后手胜局',
  PRIMARY KEY (`bs_id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COMMENT='新建比赛的详细信息' AUTO_INCREMENT=33 ;

